      axios
        .get(`http://localhost:8080/api/account/${id}`)
        .then((response) => {
          setRes(response.data); // Store account details
          console.log(response.data);
          console.log(JSON.stringify(data));
        })
        .catch((error) => console.log("Error fetching account data:", error));
    }
  }, [id]);
  return (
    <div>
      <table border="1">
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Password</th>
            <th>Mobile</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.first_Name}</td>
              <td>{item.last_Name}</td>
              <td>{item.email}</td>
              <td>{item.password}</td>
              <td>{item.mobile}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TestingAPI;
